{
  "ubx_message": {
    "name": "UBX-MGA-INI-TIME-GNSS",
    "class_id": "0x13",
    "message_id": "0x40",
    "message_type": "input",
    "payload_length": {
      "fixed": 24
    },
    "fields": [
      {
        "byte_offset": 0,
        "name": "type",
        "data_type": "U1",
        "fixed_value": 17,
        "description": "Message type (0x11 for this type)"
      },
      {
        "byte_offset": 1,
        "name": "version",
        "data_type": "U1",
        "fixed_value": 0,
        "description": "Message version (0x00 for this version)"
      },
      {
        "byte_offset": 2,
        "name": "ref",
        "data_type": "X1",
        "description": "Reference to be used to set time",
        "bitfields": [
          {
            "name": "source",
            "bit_offset": 0,
            "num_bits": 4,
            "description": "Source of time information. Currently supported:",
            "values": [
              {
                "value": 0,
                "description": "none, i.e. on receipt of message (will be inaccurate!)"
              },
              {
                "value": 1,
                "description": "relative to pulse sent to EXTINT0"
              },
              {
                "value": 2,
                "description": "relative to pulse sent to EXTINT1"
              },
              {
                "value": "3-15",
                "description": "reserved"
              }
            ]
          },
          {
            "name": "fall",
            "bit_offset": 4,
            "num_bits": 1,
            "description": "use falling edge of EXTINT pulse (default rising) - only if source is EXTINT"
          },
          {
            "name": "last",
            "bit_offset": 5,
            "num_bits": 1,
            "description": "use last EXTINT pulse (default next pulse) - only if source is EXTINT"
          }
        ]
      },
      {
        "byte_offset": 3,
        "name": "gnssId",
        "data_type": "U1",
        "description": "Source of time information. Currently supported: 0 = GPS time, 2 = Galileo time, 3 = BeiDou time, 6 = GLONASS time: week = 834 + ((N4-1)*1461 + Nt)/7, tow = (((N4-1)*1461 + Nt) % 7) * 86400 + tod"
      },
      {
        "byte_offset": 4,
        "name": "reserved0",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "reserved": true
      },
      {
        "byte_offset": 6,
        "name": "week",
        "data_type": "U2",
        "description": "GNSS week number"
      },
      {
        "byte_offset": 8,
        "name": "tow",
        "data_type": "U4",
        "unit": "s",
        "description": "GNSS time of week"
      },
      {
        "byte_offset": 12,
        "name": "ns",
        "data_type": "U4",
        "unit": "ns",
        "description": "GNSS time of week, nanosecond part from 0 to 999,999,999"
      },
      {
        "byte_offset": 16,
        "name": "tAccS",
        "data_type": "U2",
        "unit": "s",
        "description": "Seconds part of time accuracy"
      },
      {
        "byte_offset": 18,
        "name": "reserved1",
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "reserved": true
      },
      {
        "byte_offset": 20,
        "name": "tAccNs",
        "data_type": "U4",
        "unit": "ns",
        "description": "Nanoseconds part of time accuracy, from 0 to 999,999,999"
      }
    ]
  }
}
